Information in relation to loan agreements entered into by the reporting party for the purpose of either:

     - constructing a dwelling for owner-occupation. Only report those amounts relating to loan agreements where funds will be advanced by way of progress payments;

     - purchasing a dwelling for owner-occupation;

     - paying out (refinancing) existing home loans on the same residence (i.e. security unchanged), where the refinancing lender is not the original lender. It does not include the situation where an institution refinances its own loan, or where the refinancing is for the purpose of a change of residence. Include only those loans where the original lender is other than the reporting party. Exclude commitments to refinance existing loans where there is no change in the property offered as security and the institution offering the commitment was the original lender (e.g. refinancing from a variable rate loan to a fixed rate loan); or

     - Structural and non-structural changes (e.g. garages, carpets, pergolas, re-roofing, re-cladding, etc.) to owner-occupied dwellings. This excludes repairs and maintenance, swimming pools and other home improvements not involving building work 

A dwelling is a place of residence which is:
     - contained in a building which is an immobile structure;
     - private (i.e. not generally accessible to the public); and
     - self contained (i.e. includes bathing and cooking facilities).

Information in relation to loan agreements entered into by the reporting party for the purpose of purchasing or leasing trailers, buses/coaches and other motor vehicles.

This may include for example, trailer (tray and table top trailers, semi-trailers designed to connect to a prime mover, animal carriers, trailed machinery, etc.), buses and coaches, special vehicles (ambulances, hearses, tow trucks, fire engines, etc.), motor cycles/scooters, caravans (motorised and non motorised) and other non-freight carrying vehicles (mobile libraries, kitchens, workshops, etc.).

The excludes for example:
     - fork lifts;
     - cars;
     - station wagons;
     - 4WDs;
     - utilities; and
     - trucks.

Information in relation to loan agreements entered into by the reporting party for the purpose of purchasing or leasing any transport equipment, other than the following:.
     - trailers, buses/coaches and other motor vehicles;
     - aeroplanes;
     - locomotives and rolling stock; and
     - ships and motor boats.
